window.bookSummaryJSON = "The espionage activities of cunning ship's surgeon Stephen Maturin have kept him at odds with the most important French agent in the Mediterranean, Lesueur, a man with a long memory and a taste for revenge. When that revenge takes the shape of the delicate and distracting Mrs. Fielding, who also attracts the ever-wandering eye of Jack Aubrey, Stephen's sensibilities are severely tested."; 
